def get_sol(): return Solution()
class Solution:
    def swimInWater(self, grid: List[List[int]]) -> int:
        def within(x,y): return 0<=x<n and 0<=y<n
        def get_moves(x,y): return [(x+dx,y+dy) for dx,dy in [(1,0),(-1,0),(0,1),(0,-1)] if within(x+dx,y+dy)]
        VISITED=3000
        n=len(grid)
        pq = [[grid[0][0],0,0]] # time,i,j
        while pq:
            time,x,y = heappop(pq)
            if grid[x][y]==VISITED: continue
            if x==n-1 and y==n-1:
                return time
            for i,j in get_moves(x,y):
                heappush(pq,[max(time,grid[i][j]),i,j])
            grid[x][y]=VISITED
class Solution3:
    def swimInWater(self, grid: List[List[int]]) -> int:
        n=len(grid)
        vis=set()
        heap = [(grid[0][0],0,0)] # (time,i,j)
        t=0
        while heap:
            while heap and heap[0][0]==t:
                maxx,i,j=heappop(heap)
                if (i,j) in vis: continue
                vis.add((i,j))
                if i==n-1 and j==n-1:
                    return max(maxx,grid[i][j])
                for di,dj in [(1,0),(-1,0),(0,1),(0,-1)]:
                    new_i,new_j=i+di,j+dj
                    if not 0<=new_i<n or not 0<=new_j<n: continue
                    tmp=max(maxx,grid[new_i][new_j])
                    heappush(heap,(tmp,new_i,new_j))
            t+=1
class Solution2:
    # optimized
    def swimInWater(self, grid: List[List[int]]) -> int:
        n=len(grid)
        vis=set()
        vis.add((0,0))
        heap = [(grid[0][0],0,0)] # (time,i,j)
        t=0
        while heap:
            while heap and heap[0][0]==t:
                maxx,i,j=heappop(heap)
                if i==n-1 and j==n-1:
                    return max(maxx,grid[i][j])
                for di,dj in [(1,0),(-1,0),(0,1),(0,-1)]:
                    new_i,new_j=i+di,j+dj
                    if not 0<=new_i<n or not 0<=new_j<n: continue
                    if (new_i,new_j) in vis: continue
                    vis.add((new_i,new_j))
                    tmp=max(maxx,grid[new_i][new_j])
                    heappush(heap,(tmp,new_i,new_j))
            t+=1
class Solution4:
    # tle
    def swimInWater(self, grid: List[List[int]]) -> int:
        VISITED=3000
        def within(x,y): return 0<=x<n and 0<=y<n
        def get_moves(x,y): return [(x+dx,y+dy) for dx,dy in [(1,0),(-1,0),(0,1),(0,-1)] if within(x+dx,y+dy)]
        @cache
        def dfs(x,y,val):
            nonlocal res
            if x==n-1 and y==n-1:
                res=min(res,max(val,grid[x][y]))
                return
            if grid[x][y]==VISITED: return
            save_val = grid[x][y]
            grid[x][y]=VISITED
            for X,Y in get_moves(x,y):
                dfs(X,Y, max(val,save_val))
            grid[x][y]=save_val

        n=len(grid)
        res=float('inf')
        dfs(0,0,float('-inf'))
        return res

